    `,keyQuestions:["How would you approach analyzing the competitive landscape in healthtech?","What dimensions would you evaluate competitors on?","How would you identify opportunities for differentiation?","What recommendations would you make for product positioning based on your analysis?"],data:[{title:"Market Overview",content:"The digital health market for chronic condition management is growing at 18% annually and is projected to reach $30B by 2025."},{title:"Competitor List",content:"Information on 12 potential competitors ranging from established companies to early-stage startups."},{title:"Feature Matrix",content:"Preliminary comparison of key features across existing solutions including mobile apps, connected devices, and integration capabilities."},{title:"Customer Research",content:"Interviews with 25 patients and 10 healthcare providers about pain points with existing solutions."}],resources:[{title:"Digital Health Competitive Analysis",url:"#",type:"framework"},{title:"Healthcare Product Positioning",url:"#",type:"guide"},{title:"Regulatory Considerations in HealthTech",url:"#",type:"article"}],frameworks:["Porter's Five Forces","Strategic Group Mapping","Jobs To Be Done","Value Curve Analysis"],approach:`
